CREATE DEFINER=`root`@`%` PROCEDURE `tree_getRelationsKey`(in _type int,in _key nvarchar(32))
BEGIN

SELECT 'HI';


	SELECT 
        `bbdd_kaos155_borme`.`ia_data_unique`.`Relation_key` AS `_DKey`,
        `bbdd_kaos155_borme`.`ia_data_unique`.`Empresa_key` AS `_key`,
